import React from "react";
import ViewBtn from "../ViewBtn";
import SaveBtn from "../SaveBtn";



function List(props) {
  return (
    <ul className="list-group">
        <li className="list-group-item" key={props.books.items.id}>
          <img alt={props.books.title} className="img-fluid" src={props.books.imageLinks.thumbnail} />
          <ViewBtn/><SaveBtn/>
        </li>
    </ul>
  );
}

export default List;
